import image from "../../Assets/home-illustration.svg"
import styled from "styled-components";

const Cont = styled.div`
  display:flex;
  flex-direction: row;
  alignItem: center;
  justifyContent: center;`

function Home() {
  return (
    <Cont>
    <p style={{ maxWidth:300, 'font-size': 25, 'margin': 25}}>Repérez vos besoins,
    on s’occupe du reste, avec les meilleurs talents</p>
    <img src={image} alt="-img"></img>
    </Cont>
  );
}

export default Home;
